import React, { useEffect } from 'react';
import API from "../utils/API";


const Home = () => {
    const getBusinesses = () => {
        API.search()
            .then((res) => {
                console.log(res.data);
            });
    };

    useEffect(() => {
        getBusinesses();
    })

    return (
        <div>
            <h1>THIS IS HOME PAGE</h1>
            <form>
                <input placeholder="id"></input>
                <input placeholder="rating"></input>
            </form>
        </div>
    )
}

export default Home;
